import React, { useState } from 'react';
import { Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Sidebar from './components/Sidebar';
import HomePage from './components/HomePage';
import PairingDashboard from './components/PairingDashboard';
import Pairing from './components/Pairing';
import UserProfile from './components/UserProfile';

function App() {
  const [pairedStudents, setPairedStudents] = useState([]);

  const handlePairStudents = (students) => {
    setPairedStudents(students);
  };

  return (
    <div className="app">
      <Header />
      <div className="main-content">
        <Sidebar />
        <div className="content">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/pairing-dashboard" element={<PairingDashboard pairedStudents={pairedStudents} onAddToHistory={() => {}} />} />
            <Route path="/pairing" element={<Pairing onPairStudents={handlePairStudents} />} />
            <Route path="/profile" element={<UserProfile />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

export default App;
